import React from 'react';

const Navbar = () => {
  return (
    <nav className="button-navbar">
      <a href="#home" className="fas fa-home"></a>
      <a href="#featured" className="fas fa-list"></a>
      <a href="#product" className="fas fa-tags"></a>
      <a href="#reviews" className="fas fa-comments"></a>
      <a href="#blogs" className="fas fa-blog"></a>
    </nav>
  );
};

export default Navbar;

/*
Giải thích:
- Đây là component Navbar, chứa thanh điều hướng dạng biểu tượng ở dưới cùng trang.
- Mỗi liên kết là một icon với className từ Font Awesome.
- Giữ nguyên cấu trúc và className để áp dụng CSS và icon đúng.
*/
